import React, { Component } from 'react';

class Dog extends Component {
  constructor(props) {
    super(props)
  }

  componentDidMount() {
    const url = 'https://dog.ceo/api/breeds/image/random'
    const apiDog = fetch(url);
    apiDog.then( response => response.json())
    console.log(apiDog.json())
  }

  render() {
    return(
      <div>
        <h1>
          Lista de cachorros.
        </h1>
        <button>Adicionar nova imagem</button>
      </div>  
    );
  }
}

export default Dog;
